import React from 'react';
import { makeStyles, createMuiTheme, ThemeProvider } from '@material-ui/core/styles';
import Container from '@material-ui/core/Container';
import Box from '@material-ui/core/Box';
import Button from '@material-ui/core/Button';
import Icon from '@material-ui/core/Icon';
import { FilterList, MoreVert } from '@material-ui/icons';
import Grid from '@material-ui/core/Grid';
import IconButton from '@material-ui/core/IconButton';
import Chip from '@material-ui/core/Chip';

const theme = createMuiTheme({
  palette: {
    primary: {
      main: '#142357',
    },
    secondary: {
      main: '#f44336',
    },
  },
});

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
  button: {
    margin: theme.spacing(1),
  },
  chipMargin: {
    marginRight: '8px',
  },
}));

const SecondaryNav = () => {
  const classes = useStyles();

  const handleDelete = () => {
    console.info('You clicked the delete icon.');
  };

  return(
    <ThemeProvider theme={theme}>
      <Container maxWidth="lg">
        <Grid
        container
        direction="row"
        justify="space-evenly"
        alignItems="center"
        >
          <Grid xs={12} sm={6}>
            <Box display="flex" flexDirection="row" fontSize="h3.fontSize" my={3} color="primary">
              Program List
            </Box>
          </Grid>
          <Grid xs={12} sm={6}>
            <Box display="flex" justifyContent="flex-end" my={3}>
              <Button
              variant="contained"
              color="primary"
              className={classes.button}
              endIcon={<Icon>add</Icon>}
            >
              Create New Program
            </Button>
            <IconButton aria-label="listfilter" color="black">
              <FilterList />
            </IconButton>
            <IconButton aria-label="morevert" color="black">
              <MoreVert />
            </IconButton>
            </Box>
          </Grid>
          <Grid xs={12} sm={12}>
            <Box display="flex" justifyContent="flex-end" my={2}>
              <div className={classes.chipMargin}>
              <Chip label="2020" onDelete={handleDelete} color="black" variant="outlined" />
              </div>
              <Chip label="National Brands" onDelete={handleDelete} color="black" variant="outlined" />
            </Box>
          </Grid>
        </Grid>
      </Container>
    </ThemeProvider>
  )
}

export default SecondaryNav;
